// import httpClient from '../http-common';
import axios from "axios";

const getAll = () =>{
    return axios.get('http://localhost:8080/api/v1/listStudent');

}

const create = () =>{
    return axios.post('http://localhost:8080/api/v1/addStudent');
}

export default {getAll}
